import React, { useState, useCallback, useMemo, useEffect } from 'react';
import { PlacedWord, WordLocation, Clues, Dictionary, ClueData } from './types';
import Header from './components/Header';
import DropZone from './components/DropZone';
import WordPill from './components/WordPill';
import FeedbackModal from './components/FeedbackModal';
import WelcomeScreen from './components/WelcomeScreen';
import SolveScreen from './components/SolveScreen';
import DictionaryModal from './components/DictionaryModal';
import UploadScreen from './components/UploadScreen';
import { crypticDictionary } from './data/dictionary';

const defaultClues: Clues = {
  Easy: {
    clue: 'Closed part of this hutch',
    answer: 'SHUT',
    numberOfLetters: 4,
    indicator: ['part', 'of'],
    wordplay: ['this', 'hutch'],
    definition: ['Closed'],
  },
  Medium: {
    clue: 'Medium difficulty clue',
    answer: 'MEDIUM',
    numberOfLetters: 6,
    indicator: ['difficulty'],
    wordplay: ['clue'],
    definition: ['Medium'],
  },
  Hard: {
    clue: 'Hard difficulty clue here',
    answer: 'HARD',
    numberOfLetters: 4,
    indicator: ['difficulty'],
    wordplay: ['clue', 'here'],
    definition: ['Hard'],
  }
};

type FeedbackState = 'idle' | 'correct' | 'incorrect';

type View = 'welcome' | 'game' | 'solve' | 'upload';

const difficultyLevels = ['Easy', 'Medium', 'Hard'];

const App: React.FC = () => {
  const [view, setView] = useState<View>('welcome');
  const [currentDifficulty, setCurrentDifficulty] = useState('Easy');
  const [dictionary, setDictionary] = useState<Dictionary>(crypticDictionary);
  const [clues, setClues] = useState<Clues>(defaultClues);
  const [successUrl, setSuccessUrl] = useState<string>('');

  const currentClueData = useMemo(() => {
    return clues[currentDifficulty] || clues.Easy;
  }, [currentDifficulty, clues]);
  
  const initialWords = useMemo(() => {
    if (!currentClueData.clue) return [];
    return currentClueData.clue.split(' ').map((text, id) => ({
        id,
        text,
        location: 'pool' as WordLocation
    }));
  }, [currentClueData]);

  const solution = useMemo(() => ({
    indicator: currentClueData.indicator,
    wordplay: currentClueData.wordplay,
    definition: currentClueData.definition,
  }), [currentClueData]);

  const answer = currentClueData.answer;

  const [words, setWords] = useState<PlacedWord[]>([]);
  const [feedback, setFeedback] = useState<FeedbackState>('idle');
  const [draggedOverZone, setDraggedOverZone] = useState<WordLocation | null>(null);
  const [draggedWordId, setDraggedWordId] = useState<number | null>(null);
  const [pendingMove, setPendingMove] = useState<{ wordId: number; targetLocation: WordLocation; } | null>(null);
  const [completedDifficulties, setCompletedDifficulties] = useState<string[]>([]);
  const [dictionaryWord, setDictionaryWord] = useState<string | null>(null);

  useEffect(() => {
    setWords(initialWords.map(w => ({ ...w, location: 'pool' })));
  }, [initialWords]);

  const handleDragStart = (e: React.DragEvent<HTMLDivElement>, wordId: number) => {
    e.dataTransfer.setData('wordId', wordId.toString());
    e.dataTransfer.effectAllowed = 'move';
    setDraggedWordId(wordId);

    const elem = e.currentTarget;
    const clone = elem.cloneNode(true) as HTMLElement;
    clone.style.position = 'absolute';
    clone.style.top = '-1000px';
    clone.style.width = `${elem.offsetWidth}px`;
    clone.style.boxShadow = '0 10px 15px -3px rgb(0 0 0 / 0.1), 0 4px 6px -4px rgb(0 0 0 / 0.1)';
    document.body.appendChild(clone);
    e.dataTransfer.setDragImage(clone, e.nativeEvent.offsetX, e.nativeEvent.offsetY);
    
    setTimeout(() => {
      document.body.removeChild(clone);
    }, 0);
  };
  
  const handleDragEnd = () => {
    if (pendingMove) {
      setWords(currentWords =>
        currentWords.map(word =>
          word.id === pendingMove.wordId ? { ...word, location: pendingMove.targetLocation } : word
        )
      );
    }
    setDraggedOverZone(null);
    setDraggedWordId(null);
    setPendingMove(null);
  };

  const handleDrop = (e: React.DragEvent<HTMLDivElement>, targetLocation: WordLocation) => {
    e.preventDefault();
    const wordIdStr = e.dataTransfer.getData('wordId');
    if (wordIdStr) {
      const wordId = parseInt(wordIdStr, 10);
      setPendingMove({ wordId, targetLocation });
    }
    setDraggedOverZone(null);
  };

  const handleDragOver = (e: React.DragEvent<HTMLDivElement>) => {
    e.preventDefault();
  };

  const handleDragEnter = (e: React.DragEvent<HTMLDivElement>, location: WordLocation) => {
    e.preventDefault();
    setDraggedOverZone(location);
  };

  const getWordsForLocation = (location: WordLocation) => {
    return words.filter(w => w.location === location);
  };
  
  const checkAnswer = useCallback(() => {
    const userSolution = {
      indicator: getWordsForLocation('indicator').map(w => w.text).sort(),
      wordplay: getWordsForLocation('wordplay').map(w => w.text).sort(),
      definition: getWordsForLocation('definition').map(w => w.text).sort(),
    };

    const isCorrect = 
      JSON.stringify(userSolution.indicator) === JSON.stringify(solution.indicator.sort()) &&
      JSON.stringify(userSolution.wordplay) === JSON.stringify(solution.wordplay.sort()) &&
      JSON.stringify(userSolution.definition) === JSON.stringify(solution.definition.sort());

    setFeedback(isCorrect ? 'correct' : 'incorrect');
  }, [words, solution]);

  const reset = () => {
    setWords(initialWords.map(w => ({ ...w, location: 'pool' })));
    setFeedback('idle');
  }
  
  const handleBackToWelcome = () => {
    reset();
    setView('welcome');
  };
  
  const handleGoToSolve = () => {
    setFeedback('idle');
    setView('solve');
  };
  
  const handleSolveSuccess = () => {
    if (!completedDifficulties.includes(currentDifficulty)) {
      setCompletedDifficulties(prev => [...prev, currentDifficulty]);
    }

    const currentIndex = difficultyLevels.indexOf(currentDifficulty);
    if (currentIndex < difficultyLevels.length - 1) {
      setCurrentDifficulty(difficultyLevels[currentIndex + 1]);
    }
    
    reset();
    setView('welcome');
  };

  const handleDictionaryUpload = (file: File) => {
    const reader = new FileReader();
    reader.onload = (e) => {
        const text = e.target?.result as string;
        if (text) {
            const newDictionary: Dictionary = {};
            const lines = text.trim().split('\n').slice(1); // Skip header

            for (const line of lines) {
                const firstComma = line.indexOf(',');
                if (firstComma === -1) continue;
                const word = line.substring(0, firstComma).trim().toLowerCase();

                const secondComma = line.indexOf(',', firstComma + 1);
                if (secondComma === -1) continue;
                const use = line.substring(firstComma + 1, secondComma).trim();

                let definition = line.substring(secondComma + 1).trim();
                if (definition.startsWith('"') && definition.endsWith('"')) {
                    definition = definition.slice(1, -1);
                }
                
                if (!word || !use || !definition) continue;

                if (!newDictionary[word]) {
                    newDictionary[word] = { uses: {} };
                }
                newDictionary[word].uses[use] = definition;
            }
            setDictionary(newDictionary);
        }
    };
    reader.readAsText(file);
  };

  const handleCluesUpload = (file: File) => {
    const reader = new FileReader();
    reader.onload = (e) => {
      const text = e.target?.result as string;
      if (!text) return;

      const newClues: Clues = {
        Easy: { clue: '', answer: '', numberOfLetters: 0, indicator: [], wordplay: [], definition: [] },
        Medium: { clue: '', answer: '', numberOfLetters: 0, indicator: [], wordplay: [], definition: [] },
        Hard: { clue: '', answer: '', numberOfLetters: 0, indicator: [], wordplay: [], definition: [] },
      };

      const lines = text.trim().split('\n');
      if (lines.length < 2) return;
      
      const parseLine = (row: string) => row.split(',').map(field => field.trim().replace(/^"|"$/g, ''));

      const headers = parseLine(lines[0]);
      const headerMap: { [key: string]: number } = {};
      headers.forEach((header, index) => {
        if (header) headerMap[header] = index;
      });

      const dataByCategory: { [key: string]: string[] } = {};
      lines.slice(1).forEach(line => {
        const rowData = parseLine(line);
        const category = rowData[0];
        if (category) {
          dataByCategory[category] = rowData;
        }
      });

      Object.keys(newClues).forEach(difficulty => {
        const colIndex = headerMap[difficulty];
        if (colIndex === undefined) return;

        const clueData: ClueData = {
          clue: dataByCategory['Clue']?.[colIndex] || '',
          answer: dataByCategory['Answer']?.[colIndex] || '',
          numberOfLetters: parseInt(dataByCategory['Number of letters in answer']?.[colIndex] || '0', 10),
          indicator: dataByCategory['Indicator']?.[colIndex]?.split(' ').filter(Boolean) || [],
          wordplay: dataByCategory['Wordplay']?.[colIndex]?.split(' ').filter(Boolean) || [],
          definition: dataByCategory['Definition']?.[colIndex]?.split(' ').filter(Boolean) || [],
        };
        newClues[difficulty as keyof Clues] = clueData;
      });
      
      setClues(newClues);
    };
    reader.readAsText(file);
  };
  
  const handleUrlUpdate = (url: string) => {
    setSuccessUrl(url);
  };

  if (view === 'upload') {
    return (
      <UploadScreen
        onBack={() => setView('welcome')}
        onCluesUpload={handleCluesUpload}
        onDictionaryUpload={handleDictionaryUpload}
        onUrlUpdate={handleUrlUpdate}
        currentUrl={successUrl}
      />
    );
  }

  if (view === 'welcome') {
    return (
      <WelcomeScreen 
        onPlay={() => setView('game')}
        difficulty={currentDifficulty}
        onDifficultyChange={setCurrentDifficulty}
        difficultyLevels={difficultyLevels}
        completedDifficulties={completedDifficulties}
        onGoToUpload={() => setView('upload')}
      />
    );
  }

  if (view === 'solve') {
    return <SolveScreen onBack={() => setView('game')} answer={answer} onSolveSuccess={handleSolveSuccess} difficulty={currentDifficulty} onClose={handleBackToWelcome} clueData={currentClueData} dictionary={dictionary} successUrl={successUrl} />;
  }

  const clueWords = currentClueData.clue.split(" ");

  return (
    <div className="bg-gray-50 min-h-screen font-sans text-gray-800 flex items-center justify-center p-0 md:p-4">
      <div className="w-full max-w-md h-screen md:h-[900px] bg-white flex flex-col overflow-hidden md:rounded-2xl md:shadow-xl" onDragEnd={handleDragEnd}>
        <Header onBack={handleBackToWelcome} />
        <main className="flex-grow p-4 space-y-4 overflow-y-auto pb-24">
          <div className="flex items-start space-x-4">
            <img 
              src="data:image/png;base64," 
              alt="Illustration of a person thinking"
              style={{ 
              width: '104px', 
              height: 'Auto', 
             }}
            />
            <div>
              <p className="text-sm text-gray-500">Analyze the clue</p>
              <div className="flex flex-wrap items-baseline gap-x-2 mt-1">
                {clueWords.map((word, index) => (
                  <button 
                    key={index} 
                    onClick={() => setDictionaryWord(word)}
                    className="text-2xl font-serif font-bold tracking-tight bg-transparent border-0 p-0 border-b-2 border-dotted border-gray-300 hover:border-gray-500 transition-colors text-left"
                  >
                    {word}
                  </button>
                ))}
                <span className="text-2xl font-sans text-gray-500 ml-2">({currentClueData.numberOfLetters})</span>
              </div>
            </div>
          </div>

          <DropZone
            title="Cryptic indicator"
            location="indicator"
            onDrop={handleDrop}
            onDragOver={handleDragOver}
            onDragEnter={handleDragEnter}
            isDraggedOver={draggedOverZone === 'indicator'}
            bgColor="bg-brand-orange"
            borderColor="border-brand-orange-border"
          >
            {getWordsForLocation('indicator').map(word => (
              <WordPill key={word.id} word={word} onDragStart={handleDragStart} />
            ))}
          </DropZone>

          <DropZone
            title="Word play ingredients"
            location="wordplay"
            onDrop={handleDrop}
            onDragOver={handleDragOver}
            onDragEnter={handleDragEnter}
            isDraggedOver={draggedOverZone === 'wordplay'}
            bgColor="bg-brand-yellow"
            borderColor="border-brand-yellow-border"
          >
            {getWordsForLocation('wordplay').map(word => (
              <WordPill key={word.id} word={word} onDragStart={handleDragStart} />
            ))}
          </DropZone>

          <DropZone
            title="Normal definition"
            location="definition"
            onDrop={handleDrop}
            onDragOver={handleDragOver}
            onDragEnter={handleDragEnter}
            isDraggedOver={draggedOverZone === 'definition'}
            bgColor="bg-brand-gray"
            borderColor="border-brand-gray-border"
          >
            {getWordsForLocation('definition').map(word => (
              <WordPill key={word.id} word={word} onDragStart={handleDragStart} />
            ))}
          </DropZone>

          <div 
            className="flex flex-wrap gap-2 items-center justify-center pt-4 min-h-[6rem] rounded-xl transition-all"
            onDrop={(e) => handleDrop(e, 'pool')}
            onDragOver={handleDragOver}
            onDragEnter={(e) => handleDragEnter(e, 'pool')}
          >
            {initialWords.map(initialWord => {
              const word = words.find(w => w.id === initialWord.id);
              
              if (!word || word.location !== 'pool') {
                return (
                  <div key={`placeholder-${initialWord.id}`} className="bg-gray-200 rounded-full px-4 py-2 text-base font-medium text-transparent select-none">
                    {initialWord.text}
                  </div>
                );
              }
              
              const isBeingDragged = draggedWordId === word.id;
              return (
                <WordPill
                  key={word.id}
                  word={word}
                  onDragStart={handleDragStart}
                  isPlaceholder={isBeingDragged}
                />
              );
            })}
          </div>
        </main>
        <footer className="p-4 bg-white border-t border-gray-200 md:rounded-b-2xl">
          <button
            onClick={checkAnswer}
            className="w-full bg-brand-brown text-white py-4 rounded-full text-lg font-semibold hover:bg-opacity-90 transition-colors focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-brand-brown"
          >
            Check
          </button>
        </footer>
      </div>
      <FeedbackModal
        isOpen={feedback !== 'idle'}
        status={feedback}
        onClose={() => setFeedback('idle')}
        onSolve={handleGoToSolve}
      />
      <DictionaryModal 
        word={dictionaryWord}
        onClose={() => setDictionaryWord(null)}
        dictionary={dictionary}
      />
    </div>
  );
};

export default App;